import React from "react";
import "./style/Home.css";
import { useState,useEffect } from "react";
import simple from './assets/simple.json'

function Home() {
  const [movies, setMovies] = useState([]);
  const fetch = () => {
    setMovies(simple);
  }
  useEffect(() => {
    fetch();
  },[]);
  return (
    <div className="Home">
      <h1>Home</h1>
      {
        movies.map(movie => {
            console.log(movie.title)
        })
      }
    </div>
  );
}

export default Home;
